class Solution(object):
    def reversePairs(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        def merge(nums, left, mid, right):
            i, j = left, mid
            cnt = 0
            while i < mid and j < right:
                if nums[i] > 2 * nums[j]:
                    cnt += mid - i
                    j += 1
                else:
                    i += 1
            nums[left:right] = sorted(nums[left:right])
            return cnt

        def mergeSort(nums, left, right):
            if left + 1 >= right:
                return 0
            mid = (left + right) // 2
            cnt = mergeSort(nums, left, mid) + mergeSort(nums, mid, right)
            cnt += merge(nums, left, mid, right)
            return cnt

        return mergeSort(nums, 0, len(nums))

